  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bombay Hook NWR
  outlines Refuge accomplishments from September through December of 1950. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments. Resource management is
  outlined; topics include cooperative farming. The public relations section of the
  report describes recreational uses and Refuge visitors. N-R forms are attached.\",\n\t\"license_title\":
